  input: TEXT,F3XA,,"In response to your letter dated August 10, 2005 please note
    that the Committee follows all FEC guidelines for obtaining and reporting full
    name, address, occupation and employer for all donors whose aggregate contributions
    exceed $200.  Each solicitation includes a clear and conspicuous request for the
    information and informs the contributor of the federal law requirements to report
    the information.  If the information is not provided, a second letter expalining
    the law and the requirements is sent asking for the information.  This letter
    is sent within 30 days of the receipt of the contribution and does not include
    a solicitation.  A pre-addressed, pre-stamped envelope is included.  If the information
    is received, an amendment to the original filing is made or the information is
    included in our next regularly scheduled report filed as memo entries.  Regarding
    your request that we amend schedule A for contributors whose employers/occupations
    are 'inadequately identified' please note that we are reporting the information
    provided by the donor.  11 CFR 104.7 regarding Best Efforts does not address adequate
    versus inadequate employer or occupation responses given by the contributor therefore
    we are unable to change personal information provided in good faith by our contributors."
